import moment from "moment";

const initialState = {

    events:[{
        title: 'Cumpleloco',
        start: moment().toDate(),
        end: moment().add(2,'hours').toDate(),
        bgcolor:'#fafa',
        notes:'Comprar la birrah',
        user:{
            id:'123',
            name:'Santiago',
        }
     }],
    activeEvent: null


}


export const calendarReducer = (state = initialState, action) =>{

    switch (action.type) {

        
    
        default:
            return state;
    }
}
